    <div className="App">
      <h3>Full Name : { getFullName(firstname,lastName)}</h3>
      <p>Age : {mObj.age}</p>
      <p>Job : {mObj.job}</p>
     {detailInputBox}
     {mArr[0]}
    </div>
  );
}

export default App;
